import React from "react";
import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import SeviceImg from "../"

export default function Sevice() {
    return (
      <div className="service">
        <Navbar />
        <Hero
          className="hero-mid"
          img={AboutImg}
          title="About"
          btnClassName="hidden"
        />
      </div>
    );
}
